//index.js
import React from 'react';
import ReactDOM from 'react-dom';
import Cards from './Cards';
import Sdata from './Sdata';
import App from './App';

function ncard(val){
    return(
        <Cards 
        imgscr={val.imgscr}
        title={val.title}
        sname={val.sname}
        link={val.links}
    />
    );
} 

ReactDOM.render(
    <>
        <h1>List Of Series</h1>
        {Sdata.map(function ncard(val){
        return(
            <Cards 
                imgscr={val.imgscr}
                title={val.title}
                sname={val.sname}
                link={val.links}
            />
        );
        })}
    </>, document.getElementById("root"));
